import React, { useEffect } from "react";

const BookingWidget = () => {
  useEffect(() => {
    const script = document.createElement("script");
    script.src = "https://widget.simplybook.me/v2/widget/widget.js";
    script.async = true;
    script.onload = () => {
      new window.SimplybookWidget({
        widget_type: "iframe",
        url: "https://vacha-design.simplybook.me",
        theme: "simple",
        theme_settings: {
          primary_color: "#8bb5c7",
          hide_past_days: true,
          sb_base_color: "#8bb5c7",
          sb_secondary_color: "#ffffff",
          sb_text_color: "#000000",
          display_item_mode: "block",
          body_bg_color: "#ffffff",
          booking_form_background_color: "#f2f2f2",
        },
        timeline: "modern",
        datepicker: "top_calendar",
        is_rtl: false,
        app_config: {
          clear_session: 1
        }
      });
    };
    document.body.appendChild(script);
  }, []);

  return <div id="sb-widget"></div>;
};

export default BookingWidget;
